class Solution(object):
    def isIsomorphic(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        if(not len(s) == len(t)): return False
        d = {}
        for i in xrange(len(s)):
            temp = d.get(s[i], [])
            temp.append(i)
            d[s[i]] = temp
        visited = set()
        for i in xrange(len(t)):
            if(t[i] not in visited):
                visited.add(t[i])
                for e in d[s[i]]:
                    if(not t[e] == t[i]): return False   
                d.pop(s[i])
        return not d
